import React from "react";

function App() {

  let time = new Date().toLocaleTimeString();
let num =34;
  const times = ()=>{
      time =num++; 
  }

  return (
    <div className="container">
      <h1>{time}</h1>
      <button onClick={times}>Get Time</button>
    </div>
  );
}

export default App;
